// BookTrainingSession.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const BookTrainingSession = () => {
  const [trainers, setTrainers] = useState([]);
  const [form, setForm] = useState({
    trainerId: '',
    type: '',
    scheduledDate: '',
    duration: '',
    price: '',
    notes: '',
    location: ''
  });

  useEffect(() => {
    axios.get('/api/users/trainers')  // Ensure auth token is sent
      .then(res => setTrainers(res.data))
      .catch(err => console.error(err));
  }, []);

  const handleChange = e => setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = e => {
    e.preventDefault();
    axios.post('/api/training-sessions/book', form)
      .then(res => alert('Session booked successfully'))
      .catch(err => alert('Error: ' + err.response?.data?.message || 'Booking failed'));
  };

  return (
    <form onSubmit={handleSubmit}>
      <select name="trainerId" onChange={handleChange}>
        <option>Select Trainer</option>
        {trainers.map(t => <option key={t.id} value={t.id}>{t.fullName}</option>)}
      </select>
      <input type="datetime-local" name="scheduledDate" onChange={handleChange} />
      <input type="text" name="type" onChange={handleChange} />
      <input type="number" name="duration" onChange={handleChange} />
      <input type="number" name="price" onChange={handleChange} />
      <input type="text" name="location" onChange={handleChange} />
      <textarea name="notes" onChange={handleChange}></textarea>
      <button type="submit">Book</button>
    </form>
  );
};

export default BookTrainingSession;
